import axios from 'axios';
import { apiEndpoint } from './apiConfig';

export async function getMove(board, player) {
  var move = -1;
    await axios.post(`${apiEndpoint}/getMove`, {
      data: {
        board: board,
        player: player
      }
    }).then((response) => {

      move = response.data['move']
    })
    return move
}
